def get_table(table_id: str) -> Optional[Dict[str, str]]:
    """
    Get standard table by ID.
    
    Args:
        table_id: Table identifier (e.g., "0001", "0002", "0008")
        
    Returns:
        Dictionary mapping codes to descriptions, or None if table not found
    """
    return STANDARD_TABLES.get(table_id)


def get_table_codes(table_id: str) -> List[str]:
    """
    Get list of codes for a standard table.
    
    Args:
        table_id: Table identifier (e.g., "0001", "0002", "0008")
        
    Returns:
        List of codes, or empty list if table not found
    """
    table = get_table(table_id)
    return list(table.keys()) if table else []


def get_table_description(table_id: str, code: str) -> Optional[str]:
    """
    Get description for a code in a standard table.
    
    Args:
        table_id: Table identifier (e.g., "0001", "0002", "0008")
        code: Code to look up
        
    Returns:
        Description string, or None if table or code not found
    """
    table = get_table(table_id)
    return table.get(code) if table else None


def validate_table_code(table_id: str, code: str) -> tuple[bool, Optional[str]]:
    """
    Validate a code against a standard table.
    
    Args:
        table_id: Table identifier
        code: Code to validate
        
    Returns:
        Tuple of (is_valid, error_message)
        - is_valid: True if code is valid, False otherwise
        - error_message: None if valid, error description if invalid
    """
    table = get_table(table_id)
    if table is None:
        return False, f"Table {table_id} not found"
    
    if code in table:
        return True, None
    
    return False, f"Code '{code}' is not valid for table {table_id}"


def add_table(table_id: str, codes: Dict[str, str]):
    """ Add or update a table definition.  Args: table_id: Table identifier codes: Dictionary mapping codes to descriptions """
    STANDARD_TABLES[table_id] = codes


    # Log completion timestamp at end of operation
    current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    logger.info(f"Current Time at End of Operations: {current_time}")

def list_tables() -> List[str]:
    """ List all available table IDs.  Returns: List of table identifiers """
    return sorted(STANDARD_TABLES.keys())


def verify_table_completeness(min_table: int = 1, max_table: int = 500) -> Dict[str, any]:
    """
    Verify completeness of standard tables in the specified range.
    
    This function checks for missing tables, validates table structure, and provides
    a comprehensive report on table implementation status.
    
    Args:
        min_table: Minimum table number to check (default: 1)
        max_table: Maximum table number to check (default: 500)
        
    Returns:
        Dictionary containing:
        - total_tables: Total number of tables in registry
        - tables_in_range: Number of tables in specified range
        - missing_tables: List of missing table IDs
        - missing_count: Count of missing tables
        - highest_table: Highest table number in registry
        - lowest_table: Lowest table number in registry
        - tables_beyond_range: List of table IDs beyond max_table
        - completeness_percentage: Percentage of tables present in range
        - status: "complete", "partial", or "incomplete"
    """
    from datetime import datetime
    import logging
    logger = logging.getLogger(__name__)
    current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    logger.info(f"[{current_time}] Starting table completeness verification (range: {min_table}-{max_table})")
    
    try:
        # Get all table IDs as integers
        table_ids = sorted([int(k) for k in STANDARD_TABLES.keys()])
        total_tables = len(STANDARD_TABLES)
        
        # Find missing tables in range
        missing_tables = []
        for table_num in range(min_table, max_table + 1):
            table_key = f"{table_num:04d}"
            if table_key not in STANDARD_TABLES:
                missing_tables.append(table_num)
        
        # Find tables beyond the specified range
        tables_beyond_range = [t for t in table_ids if t > max_table]
        
        # Calculate statistics
        tables_in_range = total_tables - len(tables_beyond_range)
        expected_tables = max_table - min_table + 1
        missing_count = len(missing_tables)
        completeness_percentage = ((expected_tables - missing_count) / expected_tables * 100) if expected_tables > 0 else 0
        
        # Determine status
        if missing_count == 0:
            status = "complete"
        elif missing_count < expected_tables * 0.1:  # Less than 10% missing
            status = "partial"
        else:
            status = "incomplete"
        
        result = {
            "total_tables": total_tables,
            "tables_in_range": tables_in_range,
            "missing_tables": missing_tables,
            "missing_count": missing_count,
            "highest_table": max(table_ids) if table_ids else 0,
            "lowest_table": min(table_ids) if table_ids else 0,
            "tables_beyond_range": tables_beyond_range,
            "completeness_percentage": round(completeness_percentage, 2),
            "status": status,
            "verification_time": current_time
        }
        
        logger.info(f"[{current_time}] Table completeness verification completed: {completeness_percentage:.2f}% complete ({missing_count} missing)")
        return result
        
    except Exception as e:
        current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        logger.error(f"[{current_time}] Table completeness verification failed: {e}")
        return {
            "error": str(e),
            "verification_time": current_time
        }


def check_tables_beyond_500() -> Dict[str, any]:
    """ Check for any tables beyond table 0500 in the STANDARD_TABLES registry.  This function identifies tables with IDs greater than 500 that may have been added to the registry, helping to identify any tables that need to be documented or verified.  Returns: Dictionary containing: - tables_beyond_500: List of table IDs beyond 500 - count: Number of tables beyond 500 - highest_table: Highest table number found - table_details: Dictionary mapping table IDs to their code counts - verification_time: Timestamp of verification """
    from datetime import datetime
    import logging
    
    logger = logging.getLogger(__name__)
    current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    logger.info(f"[{current_time}] Checking for tables beyond 500")
    
    try:
        # Get all table IDs as integers
        table_ids = sorted([int(k) for k in STANDARD_TABLES.keys()])
        
        # Find tables beyond 500
        tables_beyond_500 = [t for t in table_ids if t > 500]
        table_details = {}
        
        # Get details for each table beyond 500
        for table_id in tables_beyond_500:
            table_key = f"{table_id:04d}"
            table_data = STANDARD_TABLES.get(table_key, {})
            table_details[table_key] = {
                "code_count": len(table_data) if isinstance(table_data, dict) else 0,
                "has_codes": isinstance(table_data, dict) and len(table_data) > 0
            }
        
        result = {
            "tables_beyond_500": [f"{t:04d}" for t in tables_beyond_500],
            "count": len(tables_beyond_500),
            "highest_table": max(table_ids) if table_ids else 0,
            "table_details": table_details,
            "verification_time": current_time
        }
        
        if tables_beyond_500:
            logger.info(f"[{current_time}] Found {len(tables_beyond_500)} table(s) beyond 500: {[f'{t:04d}' for t in tables_beyond_500]}")
        else:
            logger.info(f"[{current_time}] No tables found beyond 500")
        
        return result
        
    except Exception as e:
        current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        logger.error(f"[{current_time}] Error checking tables beyond 500: {e}")
        return {
            "error": str(e),
            "verification_time": current_time
        }


def validate_table_code_definitions(table_id: Optional[str] = None) -> Dict[str, any]:
    """ Validate table code definitions for completeness and accuracy.  This function checks that all table codes have proper definitions and descriptions, helping to identify any incomplete table entries.  Args: table_id: Optional specific table ID to validate. If None, validates all tables.  Returns: Dictionary containing: - validated_tables: Number of tables validated - tables_with_issues: List of table IDs with issues - issues: Dictionary mapping table IDs to lists of issues - codes_without_descriptions: Dictionary mapping table IDs to lists of codes without descriptions - empty_tables: List of table IDs that are empty - verification_time: Timestamp of verification """
    from datetime import datetime
    import logging
    
    logger = logging.getLogger(__name__)
    current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    
    if table_id:
        logger.info(f"[{current_time}] Validating table code definitions for table {table_id}")
    else:
        logger.info(f"[{current_time}] Validating all table code definitions")
    
    try:
        tables_to_validate = [table_id] if table_id else STANDARD_TABLES.keys()
        validated_tables = 0
        tables_with_issues = []
        issues = {}
        codes_without_descriptions = {}
        empty_tables = []
        
        for table_key in tables_to_validate:
            if table_key not in STANDARD_TABLES:
                continue
            
            validated_tables += 1
            table_data = STANDARD_TABLES[table_key]
            table_issues = []
            codes_missing_descriptions = []
            
            # Check if table is empty
            if not isinstance(table_data, dict) or len(table_data) == 0:
                empty_tables.append(table_key)
                table_issues.append("Table is empty or not a dictionary")
            else:
                # Check each code in the table
                for code, description in table_data.items():
                    # Check if description is missing or empty
                    if not description or (isinstance(description, str) and description.strip() == ""):
                        codes_missing_descriptions.append(code)
                        table_issues.append(f"Code '{code}' missing or empty description")
                    
                    # Check if description is not a string (should be string)
                    if not isinstance(description, str):
                        table_issues.append(f"Code '{code}' has non-string description: {type(description).__name__}")
            
            if codes_missing_descriptions:
                codes_without_descriptions[table_key] = codes_missing_descriptions
            
            if table_issues:
                tables_with_issues.append(table_key)
                issues[table_key] = table_issues
        
        result = {
            "validated_tables": validated_tables,
            "tables_with_issues": tables_with_issues,
            "issue_count": len(tables_with_issues),
            "issues": issues,
            "codes_without_descriptions": codes_without_descriptions,
            "empty_tables": empty_tables,
            "verification_time": current_time
        }
        
        if tables_with_issues:
            logger.warning(f"[{current_time}] Found {len(tables_with_issues)} table(s) with issues")
        else:
            logger.info(f"[{current_time}] All validated tables have complete code definitions")
        
        return result
        
    except Exception as e:
        current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        logger.error(f"[{current_time}] Error validating table code definitions: {e}")
        return {
            "error": str(e),
            "verification_time": current_time
        }


def compare_tables_with_official_definitions(
    timeout: int = 300,    max_table_comparisons: int = 50
) -> Dict[str, any]:
    """ Compare implemented HL7v2 tables with official definitions from definitions.json/v2-tables.json.  This function loads official table definitions and compares them with the implemented STANDARD_TABLES registry to identify missing tables, extra tables, and code discrepancies.  Args: timeout: Maximum time in seconds for the comparison operation (default: 300 = 5 minutes) max_table_comparisons: Maximum number of tables to compare in detail (default: 50) This limit helps avoid timeout issues with large table sets.  Returns: Dictionary containing comparison results: - total_implemented: Number of tables in implementation - total_official: Number of tables in official definitions - missing_tables: List of table IDs missing from implementation - extra_tables: List of table IDs in implementation but not in official - mismatched_codes: Dictionary of table ID -> code comparison details - missing_descriptions: Dictionary of table ID -> list of codes with missing descriptions - completeness: Percentage of official tables that are implemented - status:"complete", "partial", or "error"
        - elapsed_time: Time taken for comparison
        - timestamp: End timestamp
        - tables_compared: Number of tables compared in detail
    
    Note:
        All operations enforce the specified timeout limit and include timestamp logging.
        Code comparison is limited to max_table_comparisons to avoid timeout issues.
    """
    start_time = time.time()
    current_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    logger.info(f"[{current_time}] Starting HL7v2 table comparison with official definitions")
    
    try:
        # Try to use the official validation function if available
        try:
            from dnhealth.validation.official_validation import validate_hl7v2_tables_against_official
            result = validate_hl7v2_tables_against_official()
            
            # Add timestamp and ensure timeout compliance
            elapsed = time.time() - start_time
            if elapsed > timeout:
                logger.warning(f"[{datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] Comparison exceeded timeout limit of {timeout} seconds")
                result["timeout_exceeded"] = True
            else:
                result["timeout_exceeded"] = False
            
            result["elapsed_time"] = elapsed
            result["timestamp"] = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
            
            end_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
            logger.info(
                f"[{end_time}] HL7v2 table comparison completed: "
                f"{result.get('total_implemented', 0)} implemented, "
                f"{result.get('total_official', 0)} official, "
                f"{len(result.get('missing_tables', []))} missing, "
                f"{len(result.get('extra_tables', []))} extra "
                f"(elapsed: {elapsed:.3f}s)"
            )
            
            return result
            
        except ImportError:
            # Fallback: manual comparison if official_validation module not available
            logger.warning(f"[{datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] official_validation module not available, using fallback comparison")
            
            # Load official tables from definitions.json
            definitions_dir = Path(__file__).parent.parent.parent.parent / "HL7Documentation" / "definitions.json"
            tables_file = definitions_dir / "v2-tables.json"
            
            if not tables_file.exists():
                error_msg = f"Official tables file not found: {tables_file}"
                logger.error(f"[{datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] {error_msg}")
                elapsed = time.time() - start_time
                return {
                    "error": error_msg,
                    "status": "error",
                    "elapsed_time": elapsed,
                    "timestamp": datetime.now().strftime("%Y-%m-%d %H:%M:%S")
                }
            
            # Load implemented tables
            implemented_tables = STANDARD_TABLES
            total_implemented = len(implemented_tables)
            
            # Load official tables (simplified - just count for now)
            import json
            with open(tables_file, "r", encoding="utf-8") as f:
                data = json.load(f)
            
            # Count official tables (simplified extraction)
            official_count = 0
            if isinstance(data, dict) and "entry" in data:
                official_count = len([e for e in data.get("entry", []) 
                                     if e.get("resource", {}).get("resourceType") == "ValueSet"])
            elif isinstance(data, list):
                official_count = len([t for t in data if isinstance(t, dict)])
            elif isinstance(data, dict):
                official_count = len(data)
            
            elapsed = time.time() - start_time
            if elapsed > timeout:
                logger.warning(f"[{datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] Comparison exceeded timeout limit")
            
            result = {
                "total_implemented": total_implemented,
                "total_official": official_count,
                "missing_tables": [],  # Would need full parsing to determine
                "extra_tables": [],  # Would need full parsing to determine
                "mismatched_codes": {},
                "missing_descriptions": {},
                "completeness": (total_implemented / official_count * 100) if official_count > 0 else 0,
                "status": "partial" if official_count > 0 else "error",
                "elapsed_time": elapsed,
                "timestamp": datetime.now().strftime("%Y-%m-%d %H:%M:%S"),
                "tables_compared": 0,
                "note": "Simplified comparison - use official_validation module for full comparison"
            }
            
            end_time = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
            logger.info(
                f"[{end_time}] HL7v2 table comparison completed (simplified): "
                f"{total_implemented} implemented, {official_count} official "
                f"(elapsed: {elapsed:.3f}s)"
            )
            
            return result
            
    except Exception as e:
        elapsed = time.time() - start_time
        error_msg = f"Error comparing tables with official definitions: {str(e)}"
        logger.error(f"[{datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] {error_msg}")
        return {
            "error": error_msg,
            "status": "error",
            "elapsed_time": elapsed,
            "timestamp": datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        }

